import React, {Component} from "react"
import UserProfiles from "./UserProfiles"


export default class CustomerProfileDisplay extends Component
{
    render()
    {
        return (
            <div className="product-container">
                {this.props.users.map((user) => <UserProfiles key={user.name} user={user}/>)}
            </div>
        )
    }
}
